import React, { useState } from "react";
import { 
  Dialog, DialogTitle, DialogContent, DialogActions, Button, TextField, IconButton, Snackbar, Alert 
} from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";
import axios from "axios";
import { useHistory } from "react-router-dom";  // ‚úÖ Correct for React Router v5

const Login = ({ open = false, onClose = () => {}, onLogin = () => {} }) => { 
  const history = useHistory();  // ‚úÖ Correct usage
  const [formData, setFormData] = useState({ username: "", password: "" });
  const [message, setMessage] = useState({ text: "", type: "error" });
  const [snackbarOpen, setSnackbarOpen] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log("üîµ Sending Data:", formData);
  
    try {
      const response = await axios.post("http://localhost:8080/api/users/login", formData, {
        headers: { "Content-Type": "application/json" },
        withCredentials: true,  // Ensure backend allows credentials
      });
    
      console.log("üü¢ Full Response:", response);
      console.log("üü¢ Response Data:", response.data);
    
      if (response.data && response.data.token && response.data.role) {
        localStorage.setItem("token", response.data.token);
        localStorage.setItem("role", response.data.role);
        localStorage.setItem("username", formData.username);
    
        onLogin(response.data.token);
        setMessage({ text: "‚úÖ Login successful! Redirecting...", type: "success" });
        setSnackbarOpen(true);
    
        setTimeout(() => {
          if (response.data.role === "artist") {
            history.push("/artist-dashboard");
          } else {
            history.push("/dashboard");
          }
        }, 1500);
      } else {
        console.error("‚ùå API did not return token:", response.data);
        setMessage({ text: "‚ùå Login failed. No token received.", type: "error" });
        setSnackbarOpen(true);
      }
    } catch (error) {
      console.error("üî¥ Full API Error:", error);
    
      if (error.response) {
        setMessage({ text: error.response.data?.message || "‚ùå Invalid username or password", type: "error" });
      } else if (error.request) {
        setMessage({ text: "‚ö†Ô∏è Server not responding. Try again later.", type: "error" });
      } else {
        setMessage({ text: "‚ùå Request failed. Check network.", type: "error" });
      }
      setSnackbarOpen(true);
    }
    
  // ‚úÖ Handle Logout Function (Fixing 'handleLogout' not defined error)
  // const handleLogout = () => {
  //   localStorage.removeItem("token");
  //   localStorage.removeItem("role");
  //   localStorage.removeItem("username");
  //   history.push("/login");
  // };

  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>
        Login
        <IconButton
          aria-label="close"
          onClick={onClose}
          sx={{ position: "absolute", right: 8, top: 8 }}
        >
          <CloseIcon />
        </IconButton>
      </DialogTitle>
      <DialogContent>
        <TextField 
          label="Username" 
          name="username" 
          type="text" 
          fullWidth 
          margin="dense" 
          value={formData.username} 
          onChange={handleChange} 
          required
        />
        <TextField 
          label="Password" 
          name="password" 
          type="password" 
          fullWidth 
          margin="dense" 
          value={formData.password} 
          onChange={handleChange} 
          required
        />
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="secondary">Cancel</Button>
        <Button onClick={handleSubmit} color="primary" variant="contained">Login</Button>
      </DialogActions>

      {/* Snackbar for Feedback */}
      <Snackbar open={snackbarOpen} autoHideDuration={3000} onClose={() => setSnackbarOpen(false)}>
        <Alert onClose={() => setSnackbarOpen(false)} severity={message.type} sx={{ width: '100%' }}>
          {message.text}
        </Alert>
      </Snackbar>
    </Dialog>
  );
}
};

export default Login;
